import React from "react";

function Dashboard() {
  return (
    <div style={{ display: "flex" }}>
      <div
        style={{
          height: "100vh",
          width: "20vw",
          backgroundColor: "#FFFFFF",
          boxShadow: "0px 4px 4px 0px #00000040",
          margin:"50px"
        }}
      ></div>
      <div
        style={{ height: "100vh", width: "80vw", backgroundColor: "#EDEDED" }}
      ></div>
    </div>
  );
}

export default Dashboard;
